import ReactDOM from "react-dom";
import React from "react";
import App from "./App";

var Hello = (props) => <h1>Hello {props.name}</h1>;

ReactDOM.render(
  <React.Fragment>
    <App />
  </React.Fragment>,
  document.getElementById("root")
);
